Debug the following code and make sure it prints the sum of all values in the dictionary. data = {
  "A": [1, 2, 3],
  "B": [4, 5, 6],
  "C": [7, 8, 9]
}

def sum_dict_values(d):
  total = 0
  for v in d.values():
    total += v
  return total
